/* ==UserStyle==
@name           feedly.com image overflow fix
@namespace      github.com/Barina/Feedly-Image-width-Fix
@version        1.0.2
@description    A simple fix for images in feedly.com that takes too much space making it hard to read the content in article view.
@author         Roy Barina
@license        CC0-1.0
@preprocessor   stylus
==/UserStyle== */

@-moz-document url-prefix("https://feedly.com/") {
    .content > div > div > a > img{
        max-width: 50% !important;
    }
}

@-moz-document domain("www.ft.com")
{
div[class="article__content p402_premium"] {
    position: relative;
    width: 160% !important;
}

div[id="app"] {
    width: 180% !important;
}
}

@-moz-document url(about:home), url(about:newtab), url(about:privatebrowsing) {
    .click-target-container *, .top-sites-list * {
        color: #fff !important ;
        text-shadow: 2px 2px 2px #222 !important ;
    }

    body::before {
        content: "" ;
        z-index: -1 ;
        position: fixed ;
        top: 0 ;
        left: 0 ;
        background: #f9a no-repeat url(https://wallpaper-house.com/data/out/8/wallpaper2you_281473.jpg) center ;
        background-size: cover ;
        width: 100vw ;
        height: 100vh ;
    }
}

@-moz-document domain("2chan.net"), domain("tsumanne.net"), regexp("^https?://.*ftbucket.+"), regexp("^https?://(board|kako)\\.futakuro\\.com/.*") {
/* ---------- ふたば全域 ---------- */

body {
  background: #333;
  color: #ccc;
}
a:link, a:visited {
  color: #7bbfd8 !important;
}
a:hover {
  color: #a4d7ea !important;
}

/* 各種入力欄とプルダウンメニューの色をページと揃える */
input[type='text'], input[type='url'], input[type='password'], textarea, select {
  background-color: #333 !important;
  border-color: #aaa !important;
  color: #c5c5c5 !important;
}

/* ふたクロの左右ラベル */
#left_label, #right_label {
  background-color: #333;
}
/* 「続きを読む」「再読込」ボタンを少し小さく */
#fvw_loading{
  padding-left: 20px;
  padding-right: 20px;
}
/* ふたクロツールバーのポップアップ全般 */
.window {
  background-color: #555;
}
.drag_handle {
  background: -webkit-gradient(linear, 0% 0%, 0% 100%, from(#444), to(#555));
}

/* ツールバーのhover色 */
.f_menu:hover, .f_menu_dot_left:hover, .f_menu_dot_right:hover {
  background: -webkit-gradient(linear, 0% 0%, 0% 100%, from(#fff), to(#cde));
}
/* ツールバーの最小化とかのボタン */
.w_close, .w_pm {
  background-color: #888;
}
.w_close:hover, .w_pm:hover {
  background-color: #cde;
}
.w_pm {
    background-image: url('data:image/png;base64,');
}
.w_pm > img {
    display: none;
}
.w_close {
    background-image: url('data:image/png;base64,');
}
.w_close > img {
  display: none;
}
/* ツールバーのリンクを元の色に戻す */
#fvw_menu a.noborder {
  color: #333 !important;
}
/* 「ふたクロについて」のリンクの色 */
#info_window a {
  color: #c5c5c5;
}

/* mht保存とかのポップアップ */
#alert_window {
  background: #333;
  border-color: #333;
}

/* 赤福 */
#akahuku_sagebutton {
  color: #7bbfd8 !important;
}
.akahuku_saveimage_button {
  color: #7bbfd8 !important;
}

}

@-moz-document regexp("^https?://\\w+\\.2chan\\.net/b/futaba\\.htm$") {
/* ---------- じゃない方 ---------- */

/* レス省略数表示 */
.maxres + font[color='#707070'] {
  color: #cca;
}

/* レスNo */
.cno:hover {
  color: #a4d7ea;
}

/* 引用ポップアップ */
.qtd {
  background-color: #4a4a4a;
  box-shadow: 1px 1px 3px 1px #aaa;
  color: #ccc;
}
.qtjmp {
  color: #7bbfd8 !important;
}
.qtjmp:hover, .qsd:hover {
  color: #a4d7ea !important;
}

}

@-moz-document regexp("^https?://\\w+\\.2chan\\.net/\\w+/futaba\\.php\\?mode=cat.*$") {
/* ---------- カタログ ---------- */

table[border='1'] {
  border:1px solid #bbb;
}
table[border='1'] td {
  border:1px double #888;
}

/* スレ枠右下のメニューボタン */
.pdmc {
  background-image: url("data:image/svg+xml;base64,") !important;
  opacity: 0.8;
}
.pdmc:hover{
  background-color: rgba(164,215,234,.5) !important;
}
.pdmmc {
  border-color: #999;
  background-color: #333;
}
.pdmsc:hover {
  color: #a4d7ea;
}
/* カタログdelのダイアログ */
.pddtipc {
  border-color: #999;
  background-color: #4a4a4a;
}

/* 一度開いたスレの背景色 */
td[style='background-color: rgb(255, 204, 153);']{
  background-color: #578 !important;
}
/* 「カタログモード」の背景色をちょっと薄く */
th[bgcolor='#0040e0'] {
  background-color: #2959d1 !important;
}

/* 赤福 */
#akahuku_catalog_reload_container a, #akahuku_catalog_reload_container2 a, #akahuku_catalog_reorder_container a, #akahuku_catalog_reorder_container2 a {
  color: #7bbfd8 !important;
}
.akahuku_markup_catalog_table td a font {
  color: #ccc !important;
}
.akahuku_markup_catalog_table td a.akahuku_visited font {
  background-color: #467 !important;
}
.akahuku_cell {
  color: #ff4034 !important;
}

}

@-moz-document domain("tsumanne.net"), regexp("^https?://(board|kako)\\.futakuro\\.com/.*$"), regexp("^https?://\\w+\\.2ch.n\\.net/(\\w+/.+\\.htm.*|b/)$"), regexp("^https?://.*ftbucket.+") {
