/* レスNo */
.no_quote {
  border-bottom: 1px #ccc dotted;
}
/* delと削除のポップアップ */
.no_quote + .cno {
  background-image:url('data:image/svg+xml;base64,');
}
/* レスNo */
.cno:hover {
  color: #a4d7ea;
}
.no_quote + .cno:hover {
  background-color: rgba(164,215,234,.5);
}
.pdms:hover {
  color: #a4d7ea;
}
.pdmm, .pdd{
  border-color: #999;
  background-color: #333;
}
.pddtip {
  border-color: #999;
  background-color: #4a4a4a;
}
/* ng */
a.fvw_t_ng {
  color:#ccc !important;
}
a.fvw_t_ng:hover {
  color: #a4d7ea !important;
}
/* そうだね */
a.sod {
  color: #ccc !important;
}
a.sod:hover {
  color: #a4d7ea !important;
}
/* 引用 */
font[color='#789922'], span.s3 {
  color: #95bf2a !important;
}
/* 削除メッセージの色を少し薄く */
blockquote font[color='#ff0000'] {
  color: #f33;
}
/* レスNoと文章選択時のメニュー */
.sub_menu {
  border-color: #333;
}
.sub_contents:hover {
  background-color: #cde;
}

/* レスポップアップ */
.fvw_respop {
  background-color: #333 !important;
  color: #ccc;
}
/* あいまいの文字をちょっと濃く */
.fvw_respop > blockquote + div {
  opacity: 0.5 !important;
}

/* 新着レス数 */
.nb_left {
  background-color: #333;
}

/* スレ消滅時間とかの枠線の色 */
#border_area {
  border-color: #999;
}
/* [MHT保存]の文字色 */
#mht_dl {
  color: #7bbfd8;
}

/* QuickJump */
#quick_viewer {
  background-color: rgba(51, 51, 51, 0.5);
}
.quick_block {
  background-color: #4a4a4a;
}
.quick_block:hover {
  background-color: #666;
}

/* futaba log search */
#futaba_log_search_loglist_button {
  color: #7bbfd8;
}
#futaba_log_search_loglist_button:hover {
  color :#a4d7ea;
}

/* ふたボード */
#threadsbox #t1 td {
  background-color: #333 !important;
}
}

@-moz-document regexp("^https?://dec\\.2chan\\.net/up\\d*/.*$") {
/* ---------- あぷ(小) ---------- */

a:hover {
  background-color: #557;
}

td[bgcolor='#eeaa88']{
  background-color: #dd9977;
}

td > strong > font {
  color: #702222;
}

.files .odd {
  background-color: #4a4a4a;
}

.files tr:hover {
  background-color: #66666F;
}

}

@-moz-document regexp("^https?://(board|kako)\\.futakuro\\.com/.*$") {
th, td, div {
  color: #ccc;
}
#posttable th {
  background-color: #222;
}
#threadsbox td {
  background-color: #4a4a4a;
}
hr + pre {
  background-color: #4a4a4a !important;
}
}

@-moz-document regexp("^https?://\\w+\\.ftbucket\\.info/scrapshot/logmenu\\.htm$") {
body>font[size='2'], a[target='_blank']>img{
  display: none !important;
}
}

@-moz-document domain("tsumanne.net") {
/* トップページのやつ */
h1 a {
  background-color: #333;
}

/* スレリスト */
table#logs {
  border: solid 1px #888;
}
table#logs th, table#logs td {
  border: solid 1px #888;
}
dl.log {
  border-top: solid 1px #888;
}
table#logs tr:hover td, dl.log:hover {
  background-color: #555;
}

/* タグリスト */
#index {
  background-color: #333;
  border-left: solid 1px #888;
}
#index li a:hover {
  background-color: #777;
}

/* レス背景色 */
td[bgcolor='#f0e0d6'] {
  background-color: #4a4a4a;
}
}

